DROP TABLE IF EXISTS `Cotizacion`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Cotizacion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `numeroCaso` int(11) NOT NULL,
  `NumeroCotizacion` int(11) NOT NULL,
  `consecutivo` int(11) NOT NULL,
  `FechaCotizacion` date NOT NULL,
  `docIdCliente` varchar(31) NOT NULL,
  `idCliente` int(11) DEFAULT NULL,
  `idSucursal` int(11) DEFAULT NULL,
  `FechaInicioVigencia` date NOT NULL,
  `BeneficiarioOneroso` tinyint(4) NOT NULL,
  `DiasVigencia` int(11) NOT NULL,
  `NumeroMaxCoutas` int(11) NOT NULL,
  `ValorPolizaIvaIncl` double NOT NULL,
  `ValorMinPrimerCouta` double NOT NULL,
  `ValorPrimeraCouta` double DEFAULT NULL,
  `ValorCoutaSiguientes` double NOT NULL,
  `ValorAFinanciar` double NOT NULL,
  `Comision` int(11) NOT NULL,
  `tasaInteres` double DEFAULT NULL,
  `valorPendientePorPagar` double(12,2) NOT NULL DEFAULT '0.00',
  `interesMoraDiario` double(10,2) NOT NULL DEFAULT '0.00',
  `FechaValidezCotizacion` date NOT NULL,
  `CotizacionAceptada` tinyint(4) NOT NULL,
  `CampoExtraBusqueda` varchar(45) DEFAULT NULL,
  `EstadoCotizacion` varchar(63) DEFAULT NULL,
  `DiasEnMora` int(11) DEFAULT NULL,
  `cotizacionVIP` tinyint(4) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `idCliente_idx` (`idCliente`),
  KEY `idSucursal` (`idSucursal`),
  CONSTRAINT `Cotizacion_ibfk_1` FOREIGN KEY (`idSucursal`) REFERENCES `Sucursal` (`id`),
  CONSTRAINT `idClienteXCotizacion` FOREIGN KEY (`idCliente`) REFERENCES `Cliente` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=120 DEFAULT CHARSET=utf8;
